import './index.css'
const About = () => {
    return ( 
        <div className="about">
            <h1 className="Title">
                AR - Smart Campus Navigaion Project
            </h1>
            <h2 classNAme="creators">Creators:</h2>
        <p>Chen Zalman</p>
        <p>Pavel Sagalov</p>
        <p>Avi Digmi</p>
        <p>Ofir Buchacho</p>
    <h2>Instructor:</h2>
        <p>Itamar Mizrahi</p>
        </div>
     );
}
 
export default About;
